  [],\n\t\"revision_timestamp\": \"2015-05-06T22:26:13.951919\",\n\t\"name\": \"delta-sigma-modulated-photodetection-method-to-reduce-laser-power-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;This delta-sigma technique may
  be thought of as a form of analog-to-digital converter (ADC). The proposed network
  offers a means of processing electronic signals from transducers directly into a
  form of digital representation. By using integrated circuit methodologies, it is
  expected that very small signals can be measured more accurately than the more usual
  discrete-evel methods (ie: using discrete parts and printed circuit boards). In
  this particular study, these techniques are applied to photodetectors. By maintaining
  the quality of signals in the lower end of the dynamic range, a successful implementation
  will allow the use of smaller lasers (or further detection range for the same laser
  power) for a given application while implementing the receiving electronics in a
  much smaller and lower power package.&lt;/p&gt;\",\n\t\"license_title\": \"U.S.
